-- ----------------------------
--  Table structure for `wireless_device_ap`
-- ----------------------------
DROP TABLE IF EXISTS `wireless_device_ap`;
CREATE TABLE `wireless_device_ap` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `label` varchar(128) DEFAULT NULL,
  `apAlias` varchar(128) DEFAULT NULL,
  `isFit` int(2) DEFAULT NULL,
  `sysName` varchar(128) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `ipAddress` varchar(128) DEFAULT NULL,
  `type` varchar(128) DEFAULT NULL,
  `onlineStatus` tinyint(1) DEFAULT NULL,
  `macAddress` varchar(128) DEFAULT NULL,
  `softwareVersion` varchar(128) DEFAULT NULL,
  `hardwareVersion` varchar(128) DEFAULT NULL,
  `onlineClientCount` int(4) DEFAULT NULL,
  `serialId` varchar(128) DEFAULT NULL,
  `acLabel` varchar(128) DEFAULT NULL,
  `acIpAddress` varchar(128) DEFAULT NULL,
  `acDevId` int(11) DEFAULT NULL,
  `location` varchar(128) DEFAULT NULL,
  `connectType` tinyint(1) DEFAULT '1',
  `area` tinyint(1) DEFAULT '1' COMMENT '区域1-a，2-b，3-c，4-d',
  `side` tinyint(1) DEFAULT '1' COMMENT '左右字段,1-左2-右',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=931 DEFAULT CHARSET=utf8;

