-- ----------------------------
--  Table structure for `wireless_device_task`
-- ----------------------------
DROP TABLE IF EXISTS `wireless_device_task`;
CREATE TABLE `wireless_device_task` (
  `instId` int(11) NOT NULL AUTO_INCREMENT COMMENT '实例，唯一ID主键',
  `insDesc` varchar(255) DEFAULT NULL,
  `devId` int(11) DEFAULT NULL COMMENT '设备',
  `devDesc` varchar(255) DEFAULT NULL,
  `taskId` int(11) DEFAULT NULL COMMENT '指标',
  `taskDesc` varchar(255) DEFAULT NULL,
  `dataVal` double(11,2) DEFAULT '0.00',
  `dataTime` datetime DEFAULT NULL COMMENT '数据时间',
  `dataTimeStr` datetime DEFAULT NULL COMMENT '显示时间',
  `dataType` int(11) DEFAULT '0',
  `minVal` double(11,0) DEFAULT '0' COMMENT '最小值',
  `maxVal` double(11,0) DEFAULT '0',
  `sumVal` double(11,0) DEFAULT '0' COMMENT '汇总值',
  `sumCount` int(11) DEFAULT '0' COMMENT '汇总计数',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`instId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `wireless_device_task_summary`
-- ----------------------------
DROP TABLE IF EXISTS `wireless_device_task_summary`;
CREATE TABLE `wireless_device_task_summary` (
  `taskId` int(11) NOT NULL,
  `taskName` varchar(128) DEFAULT NULL,
  `devId` int(11) DEFAULT NULL,
  `instId` int(11) DEFAULT NULL,
  `objIndex` int(11) DEFAULT NULL,
  `objIndexDesc` varchar(128) DEFAULT NULL,
  `averageValue` varchar(128) DEFAULT NULL,
  `maximumValue` varchar(128) DEFAULT NULL,
  `minimumValue` varchar(128) DEFAULT NULL,
  `currentValue` varchar(128) DEFAULT NULL,
  `summaryValue` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`taskId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

SET FOREIGN_KEY_CHECKS = 1;
